import './LoginPage.css';
import slogo from '../images/shlogo.jpg';

function LoginPage(){
    return(
        <div>
          <div class="navbar">
             <img src={slogo} className="logo" />
             <h1>Society <span  id=" hub">HUB</span></h1>
             <nav>
               <ul>
                   <li><p className="active">Home</p></li>
                   <li><a href="#rule">Rules & Regulations</a></li>
                </ul>
              </nav>
             
            </div>
        </div>
    );
}

export default LoginPage;
